import React from 'react';
import styled from 'styled-components';
// import logo from '../assets/images/tripsoda_icon.png';
import MyComponent from '../component/te2';
import kakaoApi from '../layout/kakaolayout1';

export default function Result({ location }) {
    // console.log(location.state.list);
    
    const ap = kakaoApi;

    let tatste = 0; // 취향
        let interest = 0; // 관심사
        let re = 0;

        

    let cnt = 0;
    for( let num of location.state.list){
        if(cnt < 5) 
            tatste = tatste + num;
        else if(cnt > 4)
            interest = interest + num;

        cnt++;
    }

    console.log(tatste);
    console.log(interest);
    
    // 내외향성 // 개폐쇄성
    if(tatste < 0 && interest < 0)
    {
        console.log('안정추구');
        re = '안정추구';
    }
    else if(tatste < 0 && interest > 0)
    {
        console.log('경험추구');
        re = '경험추구';
    }
    else if(tatste > 0 && interest < 0)
    {
        console.log('감각추구');
        re = '감각추구';
    }
    else if(tatste > 0 && interest > 0)
    {
        console.log('모험추구');
        re = '모험추구';
    }

    

    
    return (
        
        <div className='App'>
           {re}
            
        </div>
        // <div>결과</div>
    // <ConsultStyled>

        // <div className="logo">
        //     <img src={logo}/>
        // </div>
    // </ConsultStyled>
)

};
const ConsultStyled = styled.div`
    max-width: 752px;
    margin: 0 auto;
    width: 100%;
    box-sizing: border-box;
    padding: 0 10px;


    .logo {
        display: flex;
        justify-content: center;
        padding-top: 30px;
    }
`;
